import { FormLabel, FormControl, InputLabel, Input } from "@mui/material";

const LoginForm = () => {
  return (
    <>
    <FormLabel>asd</FormLabel>
  <FormControl>
    <InputLabel htmlFor="username">Username</InputLabel>
    <Input id="username" aria-describedby="username" />
  </FormControl>
  </>
  );
};

export default LoginForm;
